I started practicing yoga with consistency about two years ago after what felt like a deep inner calling.

The beauty of yoga, apart from its numerous benefits, is that you can practice it in absolutely any space, in any part of the world.All you need is your mind and your body.

I have, over the years, been exposed to several different types of workouts, exercises and practices, however it is practising yoga that makes me feel the most centred, balanced and grounded.

